responses.body:
[
  {{#repeat 20}}
    {
      "name": "{{faker 'person.fullName'}}",
      "city": "{{faker 'location.city'}}",
      "studentImage": "{{faker 'image.avatar'}}",
      "state": "{{faker 'location.stateAbbr'}}",
      "country": "{{faker 'location.country'}}",
      "physics": {{faker 'number.int' min=0 max=25 max=99999}},
      "chemistry": {{faker 'number.int' min=0 max=25 max=99999}},
      "maths": {{faker 'number.int' min=0 max=25 max=99999}},
      "computer": {{faker 'number.int' min=0 max=25 max=99999}}
    }
    {{#unless @last}},{{/unless}}
  {{/repeat}}
]

[
  {{#repeat 5}}
    {
      "id": "{{faker 'number.int' max=99999}}",
      "name": "{{faker 'person.firstName'}} {{faker 'person.lastName'}}",
      "physics": "{{faker 'number.int' min=0 max=25 max=99999}}",
      "maths": "{{faker 'number.int' min=0 max=25 max=99999}}"
    }
  {{/repeat}},
  {{#repeat 5}}
    {
      "id": "{{faker 'number.int' max=99999}}",
      "name": "{{faker 'person.firstName'}} {{faker 'person.lastName'}}",
      "computer": "{{faker 'number.int' min=0 max=25 max=99999}}",
      "chemistry": "{{faker 'number.int' min=0 max=25 max=99999}}"
    }
  {{/repeat}},
  {{#repeat 5}}
    {
      "id": "{{faker 'number.int' max=99999}}",
      "name": "{{faker 'person.firstName'}} {{faker 'person.lastName'}}",
      "computers": "{{faker 'number.int' min=0 max=25 max=99999}}",
      "chemistry": "{{faker 'number.int' min=0 max=25 max=99999}}"
    }
  {{/repeat}}
]
